import React from 'react'
import { Form, Input, Scope } from 'unform'

export default function UserForm() {

    function handleSubmit(data) {
        console.log(data)
    }

    return (
        <Form onSubmit={handleSubmit}>
            <Input name="name" label="Nome" />
            <Input name="email" label="E-mail" />
        </Form>
    )
}
